script: |
  super -f text -I q3103.spq | sort > q3103.out

inputs:
  - name: q3103.spq
    data: |
      SELECT DISTINCT tab0.col0 AS col0 FROM tab0 (FORMAT parquet) WHERE ( col0 + col1 * - col1 ) NOT IN ( col0 + + col1 * col1 );
  - name: tab0

outputs:
  - name: q3103.out
    data: |
      24
      35
      89
